import React, {Component} from 'react';

class Event extends Component {  

  render(){
    return(
        <div className="Event">
            <h2>{this.props.event.name.text}</h2>
            <img src={this.props.event.logo.url} alt="Event Logo"/>
            <p>{this.props.event.description.text}</p>
            <a href={this.props.url}>Tickets & More</a>
        </div>
    )
  }
}

export default Event;
